import React from "react";

function Clock() {

  const hours = new Date().getHours();
  switch(true) {
    case (hours < 12):
      return <h1>Good Morning!</h1>;
    case (12 <= hours && hours <= 18):
      return <h1>Good Afternoon!</h1>;
    case (hours > 18):
      return <h1>Good Evening!</h1>;
  }
}

export default Clock;
